import { Box } from "@material-ui/system";
import { Typography } from "@material-ui/core";

export default function CardResult({margemBruta,margemOperacional,margemLiquida}){

    return(
        <Box sx={{height:"500px",width:"300px",backgroundColor:"#f4f4f4", borderRadius:"10px"}}>
            <Typography > Resultados</Typography>
            <div>
                <Box sx={{backgroundColor:"green", height:"50px",color:"white", borderRadius:"10px", display:"flex", alignItems:"center", justifyContent:"center", fontSize:"1.5em"}}>
                    <span>Margem Bruta: {margemBruta}%</span>
                </Box>
            </div>
            <div>Margem Operacional: {margemOperacional}%</div>
            <div>Margem Líquida: {margemLiquida}%</div>
        </Box>
    )
}
